import * as axios from "axios";

let getUrl = `https://social-network.samuraijs.com/api/1.0/ `;

export const getUsers = (mpageq = 1, mklient = 10) => {
  return axios
    .get(
      `https://social-network.samuraijs.com/api/1.0/users?page=${mpageq}&count=${mklient}`,
      {
        withCredentials: true,
      }
    )
    .then((response) => response.data);
};
